import '../styles/Navbar.css';

import "bootstrap/dist/css/bootstrap.min.css";
import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { useNavigate,NavigateFunction } from "react-router-dom";
import { useSelector } from 'react-redux';
import { RootState } from '../store';
import axios from 'axios';

export default function Navbar() {
    const Navigate: NavigateFunction = useNavigate();
    const cart = useSelector((state:RootState) => state.cart)
    const viewcart = () => {
        Navigate("/cart");
      };
      const data = localStorage.getItem('userInfo');

      const logout =async () =>{
        if (data) {
          const user = JSON.parse(data);
          console.log(user);

          await axios.post(`http://localhost:5050/addtocart`,{cartdata:cart.cart,userdata:user},{ withCredentials: true });
        }
        localStorage.removeItem('userInfo');
        localStorage.removeItem('persist:root');
        window.location.reload();
      }
      const Element = () =>{
          if (data) {
            const user = JSON.parse(data);
            return (
              <>
              <div className="d-flex" style={{color:"#fff",fontSize:"20px"}}>
                <div>
                <div>{user.fname}</div>
                {/* <div>{user.lname}</div> */}
                </div>
            </div>
            <Button onClick={logout} sx={{color:"#fff",fontSize:"20px"}}>
            logout
        </Button>
            </>
            )
          }
          else{
            return(
              <Button onClick={() => Navigate('/login')} sx={{color:"#fff",fontSize:"20px"}}>
                Login
            </Button>
            )
          }
      }
  return (


<>
<nav className="navbar navbar-expand-lg navbar-light fixed-top mainNav">
  <div className="container Navcontainer">

    <div className="navbar-brand"><img src="/assets/crown.svg" alt='crownimg'></img>CROWNCLOTH</div> 
    <div className="collapse navbar-collapse" id="navbarSupportedContent">

      <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <a className="nav-link active d-flex flex-column text-center" style={{color:"white"}} aria-current="page" href="/home"><span className="small">HOME</span></a>
        </li>
        <li className="nav-item">
          <a className="nav-link d-flex flex-column text-center" aria-current="page" href="/login"><span className="small">Notifications</span></a>
        </li>
        <li className="nav-item dropdown">
         <Button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">PROFILE</Button>

          <ul className="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
            <li><a className="dropdown-item" href="#">My profile</a></li>
            <li><a className="dropdown-item" href="#">Settings</a></li>
            <li><a className="dropdown-item" href="#">Logout</a></li>
          </ul>
        </li>
      </ul>

    </div>

  </div>
 </nav>
 <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar component="nav" sx={{backgroundColor:"#9E4D9A"}}>
        <Toolbar>
            <img src="assets/crown.svg" alt="crownimg"></img>
          <Typography
            variant="h6"
            component="div"
            sx={{ flexGrow: 1,fontSize:"40px", display: { xs: 'none', sm: 'block' } }}
          >CrownCloth
          </Typography>
          <Box sx={{ display: { xs: 'none', sm: 'block' } }}>
            <Button>
          <Element />
            </Button>
            <Button onClick={()=>Navigate('/home')} sx={{color:"#fff",fontSize:"20px"}}>
                Home
            </Button>
              <Button onClick={viewcart} sx={{ color: '#fff' }}>
                    < ShoppingCartIcon sx={{fontSize:"50px"}}/>
              </Button>
          </Box>
        </Toolbar>
      </AppBar>
      <Box component="main" sx={{ p: 3 }}>
        <Toolbar />

      </Box>
    </Box>
</>
  );
}
